import * as Styled from './styles'


export const Input =(props)=>{


    return(

        <Styled.Input>
            <label htmlFor={props.name}>{props.text}:</label>
            <input type={props.type} min={0} name={props.name} id={props.name} placeholder={props.placeholder} value={props.value} onChange={props.handleOnChange} {...(props.multiple ? props.multiple : '')}/>
        </Styled.Input>

    )
}
